  false,\n\t\"url\": null,\n\t\"notes\": \"NCEI Accession 0131250 includes physical
  and profile data collected aboard the RA-3, RA-4 and NOAA Ship RAINIER during project
  OPR-R976-RA-15 in the Beaufort Sea and Bering Sea from 2015-06-22 to 2015-08-22.
  These data include CONDUCTIVITY, HYDROSTATIC PRESSURE, SALINITY, SOUND VELOCITY,
  WATER DENSITY and WATER TEMPERATURE. The instruments used to collect these data
